import React from 'react';

const Pin = (props) => {
  return(
      <div className="pin hover-div"
         style={{
           backgroundColor: props.info.color,
           top: `${props.info.location[1]}px`,
           left: `${props.info.location[0]}px`
         }}>
         <div className='hover-div--on'>
             <u>{props.info.name}</u><br />
             {props.info.description}<br />
             <button alt="edit"><i className="material-icons small" onClick={props.editButton}>edit</i></button>
             <button alt="cancel"><i className="material-icons small" onClick={console.log("delete")}>cancel</i></button>
         </div>
      </div>
  )
}

export default Pin;
